info.onCountdownEnd(function () {
    if (info.score() < 100) {
        game.setGameOverMessage(false, "Dude. Whatafuk??")
        game.gameOver(false)
    }
    if (info.score() > 160) {
        if (info.score() > info.highScore()) {
            game.setGameOverEffect(true, effects.confetti)
            game.setGameOverEffect(true, effects.confetti)
            game.setGameOverEffect(true, effects.confetti)
            game.setGameOverMessage(true, "Your truly the new ULTRA-KILL!(er)")
            game.gameOver(true)
        } else {
            game.setGameOverMessage(true, "That was pretty Ultra!")
            game.gameOver(true)
        }
    }
    if (info.score() == 130) {
        game.setGameOverEffect(true, effects.smiles)
        game.setGameOverMessage(true, "That was kinda mid")
        game.gameOver(true)
    }
    if (info.score() == 130) {
        game.setGameOverEffect(true, effects.smiles)
        game.setGameOverMessage(true, "That was kinda mid")
        game.gameOver(true)
    }
})
